import { Link, Outlet } from 'react-router-dom';
import classes from './Navigation.module.css';

const Navigation = () => {
    return(
        <>
        <nav>
            <ul className={classes.navListWrapper}>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/">Home</Link>
                </li>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/tasks">Tasks</Link>
                </li>
                <li className={classes.navList}>
                    <Link className={classes.navLink} to="/test">Test</Link>
                </li>
                <li className={`${classes.navList} ${classes.rightMenu}`}>
                    <Link className={`${classes.navLink} ${classes.active}`} to="/result">Result</Link>
                </li>
            </ul>
        </nav>
        <Outlet/>
        </>
    );
}  
export default Navigation;
